INSERT INTO `foods` (`id`, `name`, `description`, `price`, `stars`, `people`, `selected_people`, `img`, `location`, `created_at`, `updated_at`, `type_id`) VALUES
(1, 'Bacon, Egg & Cheese Biscuit', '<h2 class=\"ingredient-group-header\" style=\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Buttermilk Biscuit:&nbsp;</span></h2><p><span class=\"ingredient-info\" style=\"box-sizing: border-box; font-size: 16px; color: rgb(24, 24, 24);\">Enriched Bleached Flour (Wheat Flour, Niacin, Iron, Thiamin Mononitrate, Riboflavin, Folic Acid), Cultured Buttermilk (Skim and/or Low-Fat Milk, Nonfat Dry Milk, Bacterial Culture Added), Water, Palm oil, Contains less than 2% of Cultured Buttermilk (Nonfat Milk, Contains 0.5% or less of Guar Gum, Tapioca Starch, Carrageenan, Locust Bean Gum, Mono &amp; Diglycerides, Modified Tapioca Starch, Salt, Sodium Citrate), Sugar, Salt, Baking Soda, Soybean Oil, Sodium Aluminum Phosphate, Modified Wheat Starch, Sodium Acid Pyrophosphate, Dextrose, Wheat Protein Isolate (Wheat Gluten, Lactic Acid), Natural Flavors, Soy Lecithin, Monocalcium Phosphate, Whey, Nonfat Dry Milk, Xanthan Gum, Biscuit Oil (Canola Oil, Hydrogenated Cottonseed Oil, Salt, Natural Flavor, Soy Lecithin, Beta Carotene [Color]). CONTAINS: WHEAT, MILK, SOY.</span><br style=\"box-sizing: border-box;\"/><br style=\"box-sizing: border-box;\"/></p><h2 class=\"ingredient-group-header\" style=\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Egg:&nbsp;</span></h2><p><span class=\"ingredient-info\" style=\"box-sizing: border-box; font-size: 16px; color: rgb(24, 24, 24);\">Egg, Soy Lecithin (Pan Spray), Salt. CONTAINS: EGG, AND SOY.</span><br style=\"box-sizing: border-box;\"/><br style=\"box-sizing: border-box;\"/></p><h2 class=\"ingredient-group-header\" style=\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Applewood Smoked Bacon:&nbsp;</span></h2><p><span class=\"ingredient-info\" style=\"box-sizing: border-box; font-size: 16px; color: rgb(24, 24, 24);\">Bacon cured with Water, Salt, Sugar, Sodium Phosphate, Sodium Erythorbate, Sodium Nitrite.</span><br style=\"box-sizing: border-box;\"/><br style=\"box-sizing: border-box;\"/></p><h2 class=\"ingredient-group-header\" style=\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">American Cheese Slice:&nbsp;</span></h2><p><span class=\"ingredient-info\" style=\"box-sizing: border-box; font-size: 16px; color: rgb(24, 24, 24);\">Milk, Cream, Water, Sodium Citrate, Salt, Contains 2% or less of Apocarotenal and Beta Carotene (Color), Cheese Culture, Citric Acid, Enzymes, Sorbic Acid (Preservative), Soy Lecithin. CONTAINS: MILK, SOY.</span></p><p><br/></p>', 4, 4, 5, 5, 'images/97105878ed23f9edaadbccc7a26c861c.png', 'Viet Nam', '2021-11-17 02:09:08', '2022-11-19 06:42:53', 2),
(2, 'Pretzel Bacon Pub Double', '<h2 class=\"ingredient-group-header\" style=\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Hamburger Patties:&nbsp;</span></h2><p><span class=\"ingredient-info\" style=\"box-sizing: border-box; font-size: 16px; color: rgb(24, 24, 24);\">Ground Beef, Salt. HAMBURGER PATTIES ARE COOKED ON THE SAME GRILL AS AND MAY COME IN CONTACT WITH INGREDIENTS THAT CONTAIN MILK AND SOY.</span><br style=\"box-sizing: border-box;\"/><br style=\"box-sizing: border-box;\"/></p><h2 class=\"ingredient-group-header\" style=\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Pretzel Bun:&nbsp;</span></h2><p><span class=\"ingredient-info\" style=\"box-sizing: border-box; font-size: 16px; color: rgb(24, 24, 24);\">Enriched Wheat Flour (Wheat Flour, Malted Barley Flour, Niacin, Iron, Thiamine Mononitrate, Riboflavin, Folic Acid), Water, Rendered Bacon Fat (Bacon Cured with Water, May Contain: Salt, Sea Salt, Potassium Chloride, Sugar, Brown Sugar, Smoke Flavor, Sodium Diacetate, Sodium Phosphates, Sodium Erythorbate, Sodium Ascorbate, Dextrose, Sodium Nitrite), Soybean Oil, Yeast, Wheat Gluten, Sugar, Salt, Mold Inhibitor (Cultured Wheat Flour, Vinegar), Smoky Bacon Type Flavor (Maltodextrin, Sunflower Oil, Natural Flavor, Modified Food Starch), Soy Lecithin, Dough Conditioner (Wheat Flour, Enzymes), Savory Bacon Type Flavor (Maltodextrin, Natural Flavor, Salt, Gum Arabic, Silicon Dioxide), Dough Conditioner (Wheat Flour, Enzymes, Salt), Flavor Enhancer (Potato Maltodextrin, Natural Flavor, Gum Arabic, Silicon Dioxide), Ascorbic Acid (Oxidation), Lye (Surface Finishing Agent), Soy Lecithin (Processing Aid). CONTAINS: WHEAT, SOY. BUNS ARE TOASTED IN A COMMON TOASTER WITH PRODUCTS THAT CONTAIN WHEAT, SOY, MILK, AND PORK FAT.</span><br style=\"box-sizing: border-box;\"/><br style=\"box-sizing: border-box;\"/></p><h2 class=\"ingredient-group-header\" style=\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Muenster Cheese:&nbsp;</span></h2><p><span class=\"ingredient-info\" style=\"box-sizing: border-box; font-size: 16px; color: rgb(24, 24, 24);\">Pasteurized Milk, Cheese Culture, Salt, Enzymes, Annatto Color. CONTAINS: MILK.</span><br style=\"box-sizing: border-box;\"/><br style=\"box-sizing: border-box;\"/></p><h2 class=\"ingredient-group-header\" style=\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Crispy Onions:&nbsp;</span></h2><p><span class=\"ingredient-info\" style=\"box-sizing: border-box; font-size: 16px; color: rgb(24, 24, 24);\">Onions, Enriched Flour (Wheat Flour, Niacin, Reduced Iron, Thiamin Mononitrate, Riboflavin, Folic Acid), Vegetable Oil (Sunflower, Safflower, and/or Canola), Salt. CONTAINS: WHEAT.</span><br style=\"box-sizing: border-box;\"/><br style=\"box-sizing: bord