 Nitrite.</span><br style=\"box-sizing: border-box;\"/><br style=\"box-sizing: border-box;\"/></p><h2 class=\"ingredient-group-header\" style=\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Smoky Honey Mustard :&nbsp;</span></h2><p><span class=\"ingredient-info\" style=\"box-sizing: border-box; font-size: 16px; color: rgb(24, 24, 24);\">Soybean Oil, Dijon Mustard (Water, Mustard Seed, Vinegar, Salt, White Wine, Citric Acid, Tartaric Acid, Spices), Water, Sugar, Honey, Tomato Paste, Brown Sugar, Apple Cider Vinegar, Egg Yolk, Distilled Vinegar, Salt, Mustard Seed, Corn Syrup, Dehydrated Garlic, Xanthan Gum, Dehydrated Onion, Natural Flavor, Natural Smoke Flavor, Oleoresin Rosemary, Oleoresin Turmeric, Celery Seed, Spice, Tamarind. CONTAINS: EGG.</span><br style=\"box-sizing: border-box;\"/><br style=\"box-sizing: border-box;\"/></p><h2 class=\"ingredient-group-header\" style=\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Crinkle Cut Pickles:&nbsp;</span></h2><p><span class=\"ingredient-info\" style=\"box-sizing: border-box; font-size: 16px; color: rgb(24, 24, 24);\">Cucumber, Water, Distilled Vinegar, Salt, Calcium Chloride, Sodium Benzoate (Preservative), Lactic Acid, Natural Flavors, Polysorbate 80 and Turmeric.</span><br style=\"box-sizing: border-box;\"/></p><p><br/></p>', 7, 5, 5, 3, 'images/84946ff677bcc5096454e491b77dda5f.png', 'Viet Nam',