(9, 'Spicy Chicken Sandwich', '<h2 class=\"ingredient-group-header\" style=\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Spicy Chicken Breast:&nbsp;</span></h2><p><span class=\"ingredient-info\" style=\"box-sizing: border-box; font-size: 16px; color: rgb(24, 24, 24);\">Chicken Breast Fillets with Rib Meat, Water, Seasoning (Salt, Sodium Phosphates, Modified Potato Starch, Spices [Including Celery Seed and Mustard], Gum Arabic, Spice Extractives, Paprika, Extractives of Paprika, Extractives of Turmeric). Breaded With: Wheat Flour, Water, Modified Corn Starch, Salt, Wheat Gluten, Spice, Yellow Corn Flour, Leavening (Sodium Acid Pyrophosphate, Sodium Bicarbonate, Monocalcium Phosphate), Natural Flavor, Maltodextrin, Extractives of Paprika, Spice Extractives. Breading set in Vegetable Oil. Cooked In Vegetable Oil (Soybean, Canola, Corn and/or Cottonseed, Hydrogenated Soybean Oil, Dimethylpolysiloxane [To Reduce Foaming]). CONTAINS: WHEAT. COOKED IN THE SAME OIL AS MENU ITEMS THAT CONTAIN WHEAT, MILK, EGG, SOY, AND FISH. GRILLED, CLASSIC, AND SPICY CHICKEN BREASTS ARE CUT ON A COMMON CUTTING BOARD, WHICH RESULTS IN CROSS-CONTACT WITH WHEAT AND SOY ALLERGENS.</span><br style=\"box-sizing: border-box;\"/><br style=\"box-sizing: border-box;\"/></p><h2 class=\"ingredient-group-header\" style=\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Premium Bun:&n