: border-box; font-weight: 700;\">Mayonnaise:&nbsp;</span></h2><p><span class=\"ingredient-info\" style=\"box-sizing: border-box; font-size: 16px; color: rgb(24, 24, 24);\">Soybean Oil, Water, Egg Yolks, Corn Syrup, Distilled Vinegar, Salt, Mustard Seed, Calcium Disodium Edta (To Protect Flavor). CONTAINS: EGG</span><br style=\"box-sizing: border-box;\"/><br style=\"box-sizing: border-box;\"/></p><h2 class=\"ingredient-group-header\" style=\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Lettuce:&nbsp;</span></h2><p><span class=\"ingredient-info\" style=\"box-sizing: border-box; font-size: 16px; color: rgb(24, 24, 24);\">Lettuce</span></p><p><br/></p>', 8, 4, 3, 3, 'images/220bda638b99558163541e3ac60a442d.png', 'Viet Nam', '2021-12-26 22:27:38', '2022-11-19 06:37:28', 3),
