, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Ketchup:&nbsp;</span></h2><p><span class=\"ingredient-info\" style=\"box-sizing: border-box; color: rgb(24, 24, 24);\">Tomato Concentrate from Red Ripe Tomatoes, Distilled Vinegar, High Fructose Corn Syrup, Corn Syrup, Salt, Natural Flavoring, Spices, Onion Powder. CONTAINS EGG.</span><br style=\"box-sizing: border-box;\"/><br style=\"box-sizing: border-box;\"/></p><h2 class=\"ingredient-group-header\" style=\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Sweet Onion:&nbsp;</span></h2><p><span class=\"ingredient-info\" style=\"box-sizing: border-box; color: rgb(24, 24, 24);\">Onion.</span><br style=\"box-sizing: border-box;\"/></p><p><br style=\"white-space: normal;\"/></p><p><br/></p>', 9, 5, 5, 5, 'images/abfc0f76be7f7b26c501bb850f0e17d1.png', 'Viet Nam', '2021-12-26 22:35:34', '2022-11-19 06:48:21', 2),
