(350, 100001, 11, '9.00', '{\"id\":11,\"name\":\"Dave\'s Double\\u00ae\",\"description\":\"<h2 class=\\\"ingredient-group-header\\\" style=\\\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">Hamburger Patties:&nbsp;<\\/span><\\/h2><p><span class=\\\"ingredient-info\\\" style=\\\"box-sizing: border-box; color: rgb(24, 24, 24);\\\">Ground Beef, Salt. HAMBURGER PATTIES ARE COOKED ON THE SAME GRILL AS AND MAY COME IN CONTACT WITH INGREDIENTS THAT CONTAIN MILK AND SOY.<\\/span><br style=\\\"box-sizing: border-box;\\\"\\/><br style=\\\"box-sizing: border-box;\\\"\\/><\\/p><h2 class=\\\"ingredient-group-header\\\" style=\\\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">Premium Bun:&nbsp;<\\/span><\\/h2><p><span class=\\\"ingredient-info\\\" style=\\\"box-sizing: border-box; color: rgb(24, 24, 24);\\\">Enriched Flour (Wheat Flour, Malted Barley Flour, Niacin, Reduced Iron, Thiamine Mononitrate, Riboflavin, Folic Acid), Water, High Fructose Corn Syrup and\\/or Sugar, Yeast, Soybean Oil, Contains less than 2% of each of the following: Ascorbic Acid (Vitamin C), Calcium Peroxide, Calcium Propionate (Added as a Preservative), Calcium Sulfate, Canola Oil, Citric Acid, Corn Starch, Dextrose, Enzymes, Maltodextrins, Modified Food Starch, Monocalcium Phosphate, Monoglycerides, Salt, Sodium Stearoyl Lactylate (SSL), Starch, Sunflower Oil, Vegetable Oil,