(352, 100002, 3, '13.00', '{\"id\":3,\"name\":\"Taco Salad\",\"description\":\"<h2 class=\\\"ingredient-group-header\\\" style=\\\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">Chili:&nbsp;<\\/span><\\/h2><p><span class=\\\"ingredient-info\\\" style=\\\"box-sizing: border-box; font-size: 16px; color: rgb(24, 24, 24);\\\">Chili Base (Chili Sauce [Water, Tomato Paste, Tomatoes (Tomatoes, Tomato Juice, Calcium Chloride), Sugar, Modified Corn Starch, Salt, Chili Pepper, Spices, Flavor Enhancer (Dextrose, Salt, Yeast Extract, Modified Corn Starch), Citric Acid, Garlic Powder, Disodium Inosinate and Disodium Guanylate, Onion Powder, Xanthan Gum], Onions, Celery, Green Peppers), Water, Ground Beef (Beef, Salt), Chili Beans (Prepared Pinto Beans, Prepared Red Kidney Beans), Soy Lecithin. CONTAINS: MILK AND SOY.<\\/span><br style=\\\"box-sizing: border-box;\\\"\\/><br style=\\\"box-sizing: border-box;\\\"\\/><\\/p><h2 class=\\\"ingredient-group-header\\\" style=\\\"box-sizing: border-box; font-family: IntroBold, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-weight: 500; line-height: 24px; color: rgb(54, 54, 54); margin-top: 0px; margin-bottom: 11px; font-size: 16px; text-transform: capitalize; padding: 0px; display: inline; letter-spacing: 0px;\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">Salad Blend:&nbsp;<\\/span><\\/h2><p><span class=\\\"ingredient-info\\\" style=\\\"box-sizing: border-box; font-size: 16px; color: rgb(24, 24, 24);\\\">Romaine Lettuce, Tomatoes, Shredded Cheddar Cheese (Cheddar Cheese [Pasteurized Milk, Cheese Culture, Salt, Enzymes, Annatto Color], Potato Starch Added to Prevent Caking, Natamycin [A Na